const n = 327308;
const string = 
"";

function substrCount(n, s) {
  let count = n;
  let replyCount = 0;
  let preBeforeValue = [];
  let beforeValue = [];
  for (let element in s) {
    const currentPosition = parseInt(element);
    if (s[currentPosition] === preBeforeValue[0] && beforeValue[1] === 0) {
      if (replyCount <= preBeforeValue[1]) {
        count += 1;
      }
    }
    if (s[currentPosition] === s[currentPosition + 1]) {
      replyCount += 1;
    } else if (s[currentPosition] !== s[currentPosition + 1]) {
      preBeforeValue = beforeValue;
      beforeValue = [s[currentPosition], replyCount];
      replyCount = 0;
    }
    count += replyCount;
    if (currentPosition + 1 === s.length) {
      break;
    }
  }
  return count;
}

console.log(substrCount(n, string));
